              name="username"
              errors={errors.username}
              register={register}
              // defaultValue="railly@gmail.com"
              required
            />
            <TextInput
              type="password"
              label="Contraseña"
              placeholder="Contraseña"
              name="password"
              errors={errors.password}
              // defaultValue="123456"
              register={register}
            />
            <Button
              className="mt-6 w-60"
              variant="primary"
              size="medium"
              type="submit"
              disabled={disabled}
            >
              Iniciar Sesión
            </Button>
          </form>
          {error && (
            <div className="flex justify-center">
              <h1 className="font-bold text-center text-red-700">
                <span>{error}</span>
              </h1>
            </div>
